import React from 'react';
import Sidebar from './Sidebar';
import SearchBar from './SearchBar';
import Content from './Content';

const Dashboard = () => {
  return (
    <div style={{ display: 'flex' }}>
      <Sidebar />
      <div style={{ flex: 1 }}>
        <SearchBar onSearch={() => {}} />
        <Content />
      </div>
    </div>
  );
};

export default Dashboard;
